// Services.js
import React from 'react';
import './services.css';

function Services() {
  return (
    <div className="services-container">
      <h2>My Services</h2>
      <div className="service">
        <img src="/frontend-development.jpg" alt="Frontend Development" />
        <h3>Frontend Development</h3>
        <p>Я специализируюсь на создании адаптивных и удобных интерфейсов с использованием современных интерфейсных технологий, таких как React,  или Vue.js.</p>
      </div>
      <div className="service">
        <img src="/backend-development.jpg" alt="Backend Development" />
        <h3>Backend Development</h3>
        <p>Building robust server-side applications and APIs using technologies like Node.js, Express, and database systems such as MongoDB or PostgreSQL.</p>
      </div>
      <div className="service">
        <img src="/full-stack-development.jpg" alt="Full Stack Development" />
        <h3>Full Stack Development</h3>
        <p>Creating end-to-end solutions by combining frontend and backend technologies to deliver a seamless and integrated user experience.</p>
      </div>
      <div className="service">
        <img src="/responsive-design.jpg" alt="Responsive Design" />
        <h3>Responsive Design</h3>
        <p>Ensuring that websites and applications look and function well on various devices and screen sizes for an optimal user experience.</p>
      </div>
      {/* Add more services as needed */}
    </div>
  );
}

export default Services;
